     &   F2*Sub159(Neu4,Neu5)*Sub409(All4,Neu4)*
     &     Sub418(All4,Neu5) + 
     &    F1*Sub177(Neu4,Neu5)*Sub413(All4,Neu4)*Sub419(All4,Neu5)

        Sub423(All4,Neu4,Neu5) = 
     &   F1*Sub159(Neu4,Neu5)*Sub409(All4,Neu4)*
     &     Sub418(All4,Neu5) + 
     &    F2*Sub177(Neu4,Neu5)*Sub413(All4,Neu4)*Sub419(All4,Neu5)

        Sub431(All4,Neu4,Neu5) = 
     &   Mf(2,gno2)*Sub423(All4,Neu4,Neu5) - 
     &    MNeu(Neu5)*Sub430(All4,Neu4,Neu5)

        Sub424(All4,Neu4,Neu5) = 
     &   Mf(2,gno1)*Sub422(All4,Neu4,Neu5) - 
     &    Mf(2,gno2)*Sub423(All4,Neu4,Neu5)

        Sub427(All4,Neu4,Neu5) = 
     &   Mf(2,gno2)*Sub425(All4,Neu4,Neu5) - 
     &    Mf(2,gno1)*Sub426(All4,Neu4,Neu5)

        Sub420(All4,Neu4,Neu5) = 
     &   F2*Sub159(Neu4,Neu5)*Sub413(All4,Neu4)*
     &     Sub418(All4,Neu5) + 
     &    F1*Sub177(Neu4,Neu5)*Sub409(All4,Neu4)*Sub419(All4,Neu5)

        Sub428(All4,Neu4,Neu5) = 
     &   Sub421*Sub420(All4,Neu4,Neu5) + 
     &    MNeu(Neu4)*Sub424(All4,Neu4,Neu5) - 
     &    MNeu(Neu5)*Sub427(All4,Neu4,Neu5)

        Sub434(All4,Neu4,Neu5) = 
     &   MNeu(Neu4)*Sub422(All4,Neu4,Neu5) + 
     &    MNeu(Neu5)*Sub426(All4,Neu4,Neu5)

        Sub429(All4,Neu4,Neu5) = 
     &   MNeu2(Neu4)*Sub420(All4,Neu4,Neu5) + 
     &    Mf(2,gno1)*MNeu(Neu4)*Sub422(All4,Neu4,Neu5)

        Sub435(All4,Neu4,Neu5) = 
     &   Mf(2,gno2)*Sub433(All4,Neu4,Neu5) - 
     &    Sub434(All4,Neu4,Neu5)

        Sub432(All4,Neu4,Neu5) = 
     &   Sub429(All4,Neu4,Neu5) - 
     &    MNeu(Neu4)*Sub431(All4,Neu4,Neu5)

        Sub436(All4,Neu4,Neu5) = 
     &   (2*m22 - Mf2(2,gno1))*Sub420(All4,Neu4,Neu5) - 
     &    Mf(2,gno1)*Sub435(All4,Neu4,Neu5)

        Sub437(All4,Neu4,Neu5) = 
     &   pave30(PVC(cc0),All4,Neu4,Neu5)*
     &     Sub432(All4,Neu4,Neu5) + 
     &    pave30(PVC(cc2),All4,Neu4,Neu5)*
     &     Sub436(All4,Neu4,Neu5)

	ENDLOOP(All4)
	ENDLOOP(Neu4)
	ENDLOOP(Neu5)

	LOOP(Gen4, 1,3,1)
	LOOP(Cha5, 1,2,1)
	LOOP(Cha4, 1,2,1)

        Sub468(Cha4,Cha5,Gen4) = 
     &   (pave78(Cha5,Gen4)*Sub459(Cha4,Cha5) + 
     &      CB*MW*pave31(PVC(cc2),Cha4,Cha5,Gen4)*
     &       Sub467(Cha4,Cha5))/(CB*MW)

	ENDLOOP(Cha4)
	ENDLOOP(Cha5)
	ENDLOOP(Gen4)

